  return (
    <div className="h-50 px-4 py-2 max-w-7xl flex justify-between text-[#F8F4EA] bg-[#579BB1]">
      <div>
        <h2 className="font-bold">Sparkosol Assessment</h2>
        <div>
          <nav className="flex gap-2">
            <p>Menu</p>
            <p>Cart</p>
            <p>Orders</p>
            <p>Chat</p>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Navbar;

